import React from 'react';

import './currency-list-item.css';

const CurrencyListItem = ({data}) => {
	const elements = data.map((item) => {
		return (
			<li id="item.key" className="currencyListItem">item.key</li>
		);
	});
	return (
		<React.Fragment>
			{elements}
		</React.Fragment>
	);
};

export default CurrencyListItem;
